import { Link } from "react-router-dom";
import { Button } from 'react-bootstrap';
const Home = () => {
  return (
    <div className="section">
    <div>
      <h1>Home Page</h1>
      <h1>Home Page-3</h1>
      <Link to="/blogs" className="btn">
        <button type="button" className="btn">
          Blogs
        </button>
      </Link>
      <Link to="/App" className="btn">
        App
      </Link>
      </div>
    </div>
  );
};

export default Home;
